import React from 'react';
import '../index.css';
import {NavLink} from 'react-router-dom';
import './Nav.css';
import 'bootstrap/dist/css/bootstrap.css';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import Home from '../Home/home';

function Nav() {

    const Nav=[
        {path:"/home",element:<Home/>},
        {path:"/contact",element:<Home/>},
        {path:"/about",element:<Home/>},
        {path:"/services",element:<Home/>}
    ]
    return (
      <>
       
        <div className='main bg-dark py-1 px-3 d-flex align-items-center justify-content-between'>
        
            <div className='logo px-3'>
                <img src="images/logomovie.png" alt="" />
            </div>
            <div className='menu px-3 d-flex justify-content-around'>
               {
                Nav.map((path,element)=>{

                    return <div className=' menu-item px-4 py-2 mx-3 '><NavLink exact activeClassName="active_class " className="menu-text text-light" to={path}  >{element}</NavLink> </div>

                })
               }
                
                {/* <div className=' menu-item px-4 py-2 mx-3 '><NavLink  activeClassName="active_class " className="menu-text text-light" to="/about" > About</NavLink> </div>
                <div className=' menu-item px-4 py-2 mx-3 '><NavLink  activeClassName="active_class " className="menu-text text-light" to="/contact" >Contact</NavLink> </div>
                <div className=' menu-item px-4 py-2 mx-3 '><NavLink activeClassName="active_class " className="menu-text text-light" to="/services" >Services</NavLink> </div> */}
            </div>
           
            <div className='d-flex justify-content-between align-items-center'>
                <input type="text" placeholder='Search' className='bg-dark px-3 py-2 rounded fs-16' />
                <AccountCircleIcon style={{color:"white",fontSize:"45px",}} className='mx-3'></AccountCircleIcon>
            </div>
        </div>

      </>
    );
}

export default Nav;
